INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 2, 2, 'und', 0, '<p class="rtejustify">Welcome to Asia book of Records- Medical Wing .</p>\r\n<p class="rtejustify">Go through the instructions carefully before proceeding further .</p>\r\n<ol>\r\n	<li>\r\n		<p class="rtejustify">Click on Patient Assessment Form</p>\r\n	</li>\r\n	<li>\r\n		<p class="rtejustify">Fill in the form.</p>\r\n	</li>\r\n	<li>\r\n		<p class="rtejustify">Measure height and weight of the patient using weighing scale and height scale.</p>\r\n	</li>\r\n	<li>\r\n		<p class="rtejustify">Fill in the medical condition from drop down medical condition tab.</p>\r\n	</li>\r\n	<li>\r\n		<p class="rtejustify">Fill in the other details like pulse rate, blood pressure using the respective instruments.</p>\r\n	</li>\r\n	<li>\r\n		<p class="rtejustify">Rest of the form should be filled after taking information from the patient.</p>\r\n	</li>\r\n	<li>\r\n		<p class="rtejustify">After the form is fully filled click on SUBMIT.</p>\r\n	</li>\r\n	<li>\r\n		<p class="rtejustify">The prescription will be emailed on your email ID and the patient’s email ID as well immediately.</p>\r\n	</li>\r\n	<li>\r\n		<p class="rtejustify">Take a printout of the prescription sent in your email ID.</p>\r\n	</li>\r\n	<li>\r\n		<p class="rtejustify">Explain the prescription to the patient and counsel him accordingly.</p>\r\n	</li>\r\n	<li>\r\n		<p class="rtejustify">Also inform the patient about the prescription that is emailed in patient’s ID.</p>\r\n	</li>\r\n</ol>\r\n<p class="rtejustify"><strong>"Patients don’t care how much you know until they know how much you care!"</strong></p>\r\n', '', 'filtered_html'),
('node', 'page', 0, 3, 3, 'und', 0, '<h1 class="rtecenter">\r\n	<span>Welcome to Asia book of Records- Medical Wing Admin Panel.</span></h1>\r\n', '', 'filtered_html'),
('node', 'webform', 0, 11, 11, 'und', 0, '<p>Patient Assistance Form</p>\r\n', '', 'filtered_html');
